import React,{Component} from 'react';
import axios from 'axios';

export default class HomePage5 extends Component{
    constructor(props){
      super(props);


      this.state = {
        news_list : [],
        translate_list : []
      };
    }


    static defaultProps = {
      apiUrl : 'http://localhost/my-app1/'  
  };
    componentDidMount = async() =>{
      const FormData = require('form-data');
      const data = new FormData();
      data.append('get_translate', true);

      const config = {
        method: 'post',
        url: this.props.apiUrl,
        headers: {},
        data : data
      };

      const translate_list = await axios(config);

      this.setState({
        translate_list : translate_list.data
      });

      /** */

      const data1 = new FormData();
      data1.append('get_posts', true);
      data1.append('post_type', 8);

      const config1 = {
        method: 'post',
        url: this.props.apiUrl,
        headers: {},
        data : data1
      };

      const news_list = await axios(config1);
      const make_news = [];

      for(let key in news_list.data.data){
        let row = news_list.data.data[key];

        make_news.push({
          id : row.id,
          title : row.title,
          featured : row.featured,
          excerpt : row.excerpt
        });

        this.setState({
          news_list : make_news
        });

      }
}




